import React from 'react'
import DonutChart from 'react-donut-chart'

function Chart() {
    return (
        <DonutChart
            data={[
                {
                    label: 'Give you up',
                    value: 25
                },
                {
                    label: '',
                    value: 75,
                    isEmpty: true
                }
            ]}
        />
    )
}

export default Chart
